import Species from './screens/Specie';
import { Route, Switch } from "react-router";

function App() {
  return (
    <div>
    <Switch>
    <Route exact path="/">
          <Home />
        </Route>

        <Route exact path="/species">
          <Species />
        </Route>


      </Switch>
      </div>
  )}

export default App;
